import "./App.css";
import NavBar from "./components/NavBar";
import { Container } from "react-bootstrap";
import MoviesList from "./components/MoviesList";

function App() {
  return (
    <div className="font color-body">
      <NavBar />
      <Container>
        <MoviesList></MoviesList>
      </Container>
    </div>
  );
}

export default App;
